    [Theory]
    [MemberData(nameof(NotImplementedOpcodeFeeder))]
    public void ReturnNonEmptyNameAndZeroOpcode_WhenOpcodeIsNotImplemented(SampleCpu sampleCpu)
    {
        var tracer = new DisplayTracerSpy();
        var sut = Utilities.CreateSubjectUnderTestFromSampleForOpcodes(sampleCpu.Initial, tracer);
        var exception = Assert.Throws<NotImplementedException>(sut.Step);

        Assert.StartsWith("Not implemented opcode", exception.Message);
        Assert.Contains(sampleCpu.Name[0..2].ToUpper(), exception.Message); // Not ideal
        Assert.Equal("NI", tracer.Name);
        Assert.Equal(0, tracer.Opcode);
    }

